import React from 'react';
import PropTypes from 'prop-types';

const LicencasMapModal = ({ formData, onChange, onSubmit, onCancel, isEditMode }) => {
  const formStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '10px', // Reduzido de 15px
    maxWidth: '300px', // Limita a largura pra caber no popup
    padding: '10px', // Reduzido de 20px
    overflowY: 'auto', // Adiciona rolagem vertical se necessário
    maxHeight: '400px', // Limita a altura máxima
  };

  const inputStyle = {
    padding: '8px', // Reduzido de 10px
    borderRadius: '4px', // Levemente menor
    border: '1px solid #ccc',
    fontSize: '12px', // Reduzido de 14px
    width: '100%',
    boxSizing: 'border-box',
  };

  const submitButtonStyle = {
    padding: '8px 16px', // Reduzido de 10px 20px
    backgroundColor: '#007bff',
    color: 'white',
    border: 'none',
    borderRadius: '4px',
    fontSize: '12px', // Reduzido de 16px
    cursor: 'pointer',
    transition: 'background-color 0.3s',
  };

  const cancelButtonStyle = {
    padding: '8px 16px', // Reduzido de 10px 20px
    backgroundColor: '#6c757d',
    color: 'white',
    border: 'none',
    borderRadius: '4px',
    fontSize: '12px', // Reduzido de 16px
    cursor: 'pointer',
    transition: 'background-color 0.3s',
    marginTop: '5px', // Reduzido de 10px
  };

  return (
    <form onSubmit={onSubmit} style={formStyle}>
      <div className="form-group">
        <label>Razão Social:</label>
        <input
          type="text"
          name="razao_social"
          value={formData.razao_social}
          onChange={onChange}
          required
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Atividade:</label>
        <input
          type="text"
          name="atividade"
          value={formData.atividade}
          onChange={onChange}
          required
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Endereço:</label>
        <input
          type="text"
          name="endereco"
          value={formData.endereco}
          onChange={onChange}
          required
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Núm. da Licença:</label>
        <input
          type="text"
          name="numero_licenca"
          value={formData.numero_licenca}
          onChange={onChange}
          required={!isEditMode || formData.status !== 'Processo Aberto'}
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Núm. do Processo:</label>
        <input
          type="text"
          name="numero_processo"
          value={formData.numero_processo || ''}
          onChange={onChange}
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Tipo de Licença:</label>
        <input
          type="text"
          name="tipo_licenca"
          value={formData.tipo_licenca}
          onChange={onChange}
          required={!isEditMode || formData.status !== 'Processo Aberto'}
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Data de Emissão:</label>
        <input
          type="date"
          name="data_emissao"
          value={formData.data_emissao}
          onChange={onChange}
          required={!isEditMode || formData.status !== 'Processo Aberto'}
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Validade:</label>
        <input
          type="date"
          name="validade"
          value={formData.validade}
          onChange={onChange}
          required={!isEditMode || formData.status !== 'Processo Aberto'}
          style={inputStyle}
        />
      </div>

      <div className="form-group">
        <label>Status:</label>
        <select
          name="status"
          value={formData.status}
          onChange={onChange}
          style={inputStyle}
        >
          <option value="Ativo">Ativo</option>
          <option value="Em Análise">Em Análise</option>
          <option value="Processo Aberto">Processo Aberto</option>
        </select>
      </div>

      <div style={{ display: 'flex', gap: '5px' }}>
        <button type="submit" style={submitButtonStyle}>
          {isEditMode ? 'Atualizar' : 'Salvar'}
        </button>
        <button type="button" onClick={onCancel} style={cancelButtonStyle}>
          Cancelar
        </button>
      </div>
    </form>
  );
};

LicencasMapModal.propTypes = {
  formData: PropTypes.object.isRequired,
  onChange: PropTypes.func.isRequired,
  onSubmit: PropTypes.func.isRequired,
  onCancel: PropTypes.func.isRequired,
  isEditMode: PropTypes.bool.isRequired,
};

export default LicencasMapModal;
